Beverley Ann Mitchell (born January 22, 1981) is an American actress and country music singer. She is perhaps best known for her role as Reverend Lucy Camden-Kinkirk on the television series 7th Heaven.

Beverley Mitchell is her self-titled debut album from American actress and singer, Beverley Mitchell. It was released on January 23, 2007. She co-wrote 8 songs on her debut album. Her first single &quot;Angel&quot; was released in late 2006. The album debuted at #30 (Hot Shot) on the Billboard Top Country Albums chart and #8 on the Billboard Top Heatseekers chart.

